import React from "react";
import "./City.css";
import Card from "../../UI/Card";
import Container from "../../UI/Container";
const City = (props) => {
  return (
    <Container>
      <img src={props.item.image} alt=""></img>
      <div className="city-detail">
        <h1>{props.item.name}</h1>
        <p>{props.item.subText}</p>
      </div>
    </Container>
  );
};

export default City;
